import React from 'react';
import s from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = () => {


    let postsData = [
        {"id": 1, "message": "Hello, how are you?", "likesCount": 5},
        {"id": 2, "message": "My, first post!", "likesCount": 2}
    ]

  return (
    <div className={s.myPostWrap}>
      <h3>My posts</h3>
      <div className={s.sendText}>
        <textarea></textarea>
        <button className={s.btn}>Add post</button>

      </div>
      <div className={s.posts}>
          {postsData.map((post, index) => {
              <Post message = {post.message} likeCount = {post.likesCount} />
          })}

          {/*{<Post message={postsData[1].message} likeCount={postsData[1].likesCount}/>}*/}
      </div>
    </div>
  )

}

export default MyPosts;
